import React from 'react'
import 'tachyons'
import Header from './components/Header/Header'
import Main from './components/Main/Main';


class App extends React.Component {
  render () {
    return (
      <React.Fragment>
        <Header />
        <Main />
      </React.Fragment>
    )
  }
}

export default App
